import React from "react";
import Element from "./Element";

export default function PeriodicTable() {
  return (
    <div>
      <Element
        elementName="Hydrogen"
        elementSymbol="H"
        elementNumber="1"
        elementMass="1.008"
      />
      <Element
        elementName="Helium"
        elementSymbol="He"
        elementNumber="2"
        elementMass="4"
      />
    </div>
  );
}
